import "./App.css";

const App = () => {
  return (
    <div>
      <div>
        <HeaderComp />
        <Technologist />
      </div>
    </div>
  );
};

const Technologist = () => {
  return (
    <div>
      <ul>
        <li>html</li>
        <li>css</li>
        <li >jsde</li>
        <li>react</li>
      </ul>
    </div>
  );
};

const HeaderComp = () => {
  return (
    <div>
      <a href="#s"> Home</a>
      <a href="#s"> About</a>
      <a href="#s"> news</a>
      <a href="#s"> contacts</a>
    </div>
  );
};

export default App;
